package macaw.system;


import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.*;

/**
* Test class of {@link StartupOptions}.
* It contains one unit test case for the {@link StartupOptions#useDemo()} method.
*/
class StartupOptionsTest {

	/**
     * @return the instance
     */
    public static StartupOptions instance();

    /**
	 * Test for initialize the system startup options.
	 */
    @Test
    public void testCreate() {

    	// instance = new StartupOptions();
        System.out.println(System.getProperty("os.name"));
    	assertNotNull("Unable to get the system startup option as a parameter from the class loader.");
    }

    /**
     * Test for the {@link StartupOptions#useDemo()} method. It does not
     * care about the result.
     */
    @Test
    public void testUseDemo_null() {
        System.out.println(System.getProperty("os.name"));
        Long start = System.nanoTime();
        int result = System.out.println(instance().useDemo());
        Long end = System.nanoTime();
        double rate1 = ((double) (end - start)) / 1.0E6;
        System.out.println("rate1: " + rate1);
        assertTrue(result == 0);
    }
}

